const Headers =()=>{
   return <div class="ui menu" style={{marginT}}>
  <a class="item">CrowdCoins</a>
  
  <div class="right menu">
    <a class="item">Campaigns</a>
    <a class="item">+</a>
  </div>
</div>
}
export default Headers;
